class RemiConnect {

    constructor(_openModalButtons, options) {

        this.buttonArray = [];

        if (Array.isArray(_openModalButtons)) {
            this.buttonArray = _openModalButtons;
        } else {
            this.buttonArray.push(_openModalButtons);
        }

        this.openModal = this.openModal.bind(this);
        this.closeModal = this.closeModal.bind(this);

        this.infuraId = options.infuraId;
        this.onConnect = options.onConnect;
        this.onFail = options.onFail;

        this.acceptedChains = options.acceptedChains || null;
        this.onWrongChain = options.onWrongChain || null;
        this.imagesDirectory = options.imagesDirectory || null;
        this.customProviders = options.customProviders || null;
        this.customRPC = options.customRPC || null;
        this.walletConnectConfig = options.walletConnectConfig || null;

        this.loadedProviders = {};

        this.defaultImages = {
            0: `data:image/png;base64,`,
            1: `data:image/png;base64,`,
            2: `data:image/png;base64,`,
            3: `data:image/png;base64,`,
            4: `data:image/png;base64,`,
            5: `data:image/png;base64,`
        }

        this.providerData = {
            WalletConnect: {
                ethIdentifier: "",
                name: "WalletConnect",
                logoName: "walletconnect.png",
                defaultImage: this.defaultImages[0],
            },
            Brave: {
                ethIdentifier: "isBraveWallet",
                name: "Brave Wallet",
                logoName: "brave.png",
                defaultImage: this.defaultImages[3],
            },
            MetaMask: {
                ethIdentifier: "isMetaMask",
                name: "MetaMask",
                logoName: "metamask.png",
                defaultImage: this.defaultImages[1],
            },
            Coinbase: {
                ethIdentifier: "isCoinbaseWallet",
                name: "Coinbase Wallet",
                logoName: "coinbase.png",
                defaultImage: this.defaultImages[2],
            },
            Frame: {
                ethIdentifier: "isFrame",
                name: "Frame",
                logoName: "frame.png",
                defaultImage: this.defaultImages[4],
            },
            Unidentified: {
                ethIdentifier: "?",
                name: "Unidentified Provider",
                logoName: "unidentified.png",
                defaultImage: this.defaultImages[5],
            }
        }

        if (this.customProviders != null) {
            this.providerData = {
                ...this.providerData,
                ...this.customProviders
            };
        }

        this.providerSelectionList;
        this.modalElement;
        this.currentAccount;
        this.currentProvider;
        this.connected = false;

        this.createModal();
        this.getInjectedWallets();

        for (var el of this.buttonArray) {
            el.onclick = this.openModal;
        }
    }

    createStyle() {
        var style = document.createElement("style");
        style.innerHTML = `
		.hidden {
			opacity: 0 !important;
			pointer-events: none;
		}

		#walletSelectBlackout {
			top: 0px;
			position: fixed;
			padding: 0px;
			margin: 0px;
			width: 100vw;
			height: 100vh;
			margin-left: -8px;
			background-color: rgba(0, 0, 0, 0.9);
			opacity: 1;
			z-index: 90;
			transition: opacity 0.4s;
		}

		#walletSelectWrapper {
			background: url("Assets/RemiConnect/Desktop/remiconnect_module.svg") no-repeat;
			position: relative;
			width: 490px;
			height: 400px;
			margin: auto;
			top: 20%;
			font-family: "CustomArialNarrow", Helvetica, sans-serif;
			font-style: italic;
		}

		@media (max-aspect-ratio: 5/4) {
			#walletSelectWrapper {
				background: url("Assets/RemiConnect/Mobile/m_remiconnect_module.svg") no-repeat;
				width: 358px;
				height: 512px;
			}
			#walletSelectWrapper h1 { 
				font-size: 23px;
			}
			#walletSelectList li {
				width: 251px !important;
				height: 35px !important;
				font-size: 16px !important;
				background: url("Assets/RemiConnect/Mobile/m_wallet_btn_inactive.svg") no-repeat !important;
			}
			#walletSelectList li:active {
				background: url("Assets/RemiConnect/Mobile/m_wallet_btn_active.svg") no-repeat !important;
			}
		}

		#walletSelectWrapper h1 { 
			font-size: 25px;
			padding-top: 7px;
		} 

		#walletSelectList {
			height: auto;
			z-index: 30;
			list-style: none;
			padding-left: 0;
			margin: auto;
			margin-top: 100px;
		}

		#walletSelectList li {
			width: 383px;
			height: 35px;
			font-size: 18px; 
			font-weight: bold;
			text-align: center;
			padding: 2px;
			padding-bottom: 9px;
			opacity: 1;
			margin-left: 41px;
			background: url("Assets/RemiConnect/Desktop/wallet_btn_inactive.svg") no-repeat;
		}

		#walletSelectList li:hover {
			cursor: pointer;
		}
		#walletSelectList li:active {
			cursor: pointer;
			background: url("Assets/RemiConnect/Desktop/wallet_btn_active.svg") no-repeat;
		}

		.walletSelectionLogo {
			position: relative;
			height: 25px;
			width: auto;
			top: 6px;
			margin-right: 8px;
		}

		#walletSelectionWatermark {
			position: relative;
			/*height: 40px;*/
			width: 60px;
			margin: 15px auto;
			overflow: hidden;
			display: block;
			margin-top: 10px;
			margin-bottom: 30px;
			bottom: -20px;
			opacity: 0.9;
		}

		#walletSelectionExit {
			background: url("Assets/RemiConnect/remiconnect_x_inactive.svg") no-repeat;
			position: absolute;
			height: 23px;
			width: 23px;
			right: 12px;
			top: 10px;
			cursor: pointer;
		}

		#walletSelectionExit:hover {
			background: url("Assets/RemiConnect/remiconnect_x_active.svg") no-repeat;
		}

		#walletSelectionTitle {
			text-align: left;
			text-indent: 22px;
			margin-bottom: 30px;
			margin-top: 10px;
		}
		`

        document.body.appendChild(style);
    }

    createModal() {
        this.createStyle();

        var blackout = document.createElement("div");
        blackout.id = "walletSelectBlackout";
        blackout.classList.add("hidden");

        var wrapper = document.createElement("div");
        wrapper.id = "walletSelectWrapper"

        var closeModal = document.createElement("img");
        closeModal.id = "walletSelectionExit";

        var title = document.createElement("h1");
        title.innerHTML = "RemiConnect"
        title.id = "walletSelectionTitle";

        var selectionList = document.createElement("ol");
        selectionList.id = "walletSelectList";

        wrapper.appendChild(closeModal);
        wrapper.appendChild(title);
        wrapper.appendChild(selectionList);
        blackout.appendChild(wrapper);

        this.providerSelectionList = selectionList;
        this.modalElement = blackout;

        closeModal.onclick = this.closeModal;

        document.body.appendChild(blackout);
    }

    createWalletSelectElement(providerData) {
        var wrapper = document.createElement("li");
        var logo = document.createElement("img");
        var text = document.createElement("span")

        logo.classList.add("walletSelectionLogo");
        text.classList.add("walletSelectionText");

        if (this.imagesDirectory == null) {
            logo.src = providerData.defaultImage;
        } else {
            logo.src = `${this.imagesDirectory}/${providerData.logoName}.png`
        }
        text.innerHTML = providerData.name;

        wrapper.onclick = ()=>{
            this.switchProvider(providerData.name)
        }
        ;

        wrapper.appendChild(logo);
        wrapper.appendChild(text);

        return wrapper;
    }

    determineWalletType(provider) {

        if (Object.keys(provider).length == 0) {
            return this.providerData.WalletConnect;
        }

        for (var schemaKey of Object.keys(this.providerData)) {
            var schema = this.providerData[schemaKey];
            if (provider[schema.ethIdentifier] == true) {
                return schema;
            }
        }

        return this.providerData.Unidentified;
    }

    addWalletOption(provider) {
        var providerData = this.determineWalletType(provider);
        var providerSelectionElement = this.createWalletSelectElement(providerData);

        this.providerSelectionList.appendChild(providerSelectionElement);
        this.loadedProviders[providerData.name] = provider;
    }

    getInjectedWallets() {
        // Add default WalletConnect option
        var walletOptions = [{}];
        if (window.ethereum != undefined) {
            if (window.ethereum.providers == undefined || window.ethereum == null) {
                console.log("Only one provider found.")
                walletOptions.push(window.ethereum);
            } else {
                console.log("Multiple Providers Detected.");
                for (var provider of window.ethereum.providers) {
                    walletOptions.push(provider);
                }
            }
        }

        // Sort alphabetically
        walletOptions.sort((a,b)=>{
            var walletNameA = this.determineWalletType(a).name;
            var walletNameB = this.determineWalletType(b).name;

            if (walletNameA > walletNameB) {
                return 1;
            } else if (walletNameA < walletNameB) {
                return -1;
            } else {
                return 0;
            }
        }
        )

        for (var provider of walletOptions) {
            this.addWalletOption(provider);
        }
    }

    openModal() {
        this.modalElement.classList.remove("hidden")
    }

    closeModal() {
        this.modalElement.classList.add("hidden")
    }

    async switchProvider(providerName) {
        this.connect(this.loadedProviders[providerName]);
    }

    async connect(provider) {
        localStorage.clear();
        this.closeModal();

        var completedHandshake = false;
        var errorMessage = "";
        var accounts;
        var ethProvider = provider;

        // Default case. WalletConnect is an empty provider.
        if (Object.keys(ethProvider).length == 0) {
            // walletconnect opts go here
            var WCOptions = {
                infuraId: this.infuraId
            }

            if (this.walletConnectConfig != null) {
                WCOptions = this.walletConnectConfig
            } else {
                if (this.customRPC != null) {
                    WCOptions.rpc = {
                        ...this.customRPC
                    }
                }
            }
            ethProvider = new WalletConnectProvider.default(WCOptions);

            try {
                await ethProvider.enable();
                accounts = await ethProvider.accounts;
                completedHandshake = true;
            } catch (err) {
                errorMessage = err;
            }
        } else {
            try {
                accounts = await ethProvider.request({
                    method: 'eth_requestAccounts'
                })
                completedHandshake = true;
            } catch (err) {
                errorMessage = err;
            }
        }

        if (!completedHandshake) {
            this.onFail(errorMessage);
            return;
        }

        // Maybe this is kind of jank! Test later!
        var chainId = `${ethProvider.chainId}`;
        if (chainId.substring(0, 2) != "0x") {
            chainId = "0x" + chainId;
        }

        if (this.acceptedChains != null && this.onWrongChain != null && !this.acceptedChains.includes(chainId)) {
            this.onWrongChain(chainId, ethProvider);
            return;
        }

        this.connected = true;
        this.currentAccount = accounts[0];
        this.currentProvider = ethProvider;
        this.onConnect(this.currentProvider);
    }
    ;
}
;
